This is a very varied and really exciting climb that  finishes just left of Birdland. Start up Birdland to the first bolt, downclimb a bit and traverse left into the wild undercling crack (with optional .5 and/or #2 clipped long followed immediately by a bolt

). Bust out of the undercling by finding a hidden pocket and continuing left to a brief rest. Then continue climbing straight up through the bulge and temporarily re-join Birdland. At the last shelf, place a few pieces of gear and head up and left on a wildly exciting rail. After two bolts, climb steep and pumpy 5.9 jugs while placing gear along the way.

I had a BLAST on this route. It's not your typical route, which is why it really stood out to me. Enjoy!!
